import '../../data/models/filter_and_tap_dto.dart';class FilterAndTaps {  FilterAndTaps({    this.filters,    this.tabs,  });  List<FiltersAdminWallet>? filters;  List<TabsAdminWallet>? tabs;  factory FilterAndTaps.fromDto(FilterAndTapDto json) {    return FilterAndTaps(      filters: json.filters?.map((e) => FiltersAdminWallet.fromDto(e)).toList(),      tabs: json.tabs?.map((e) => TabsAdminWallet.fromDto(e)).toList(),    );  }}class TabsAdminWallet {  TabsAdminWallet({    this.id,    this.name,  });  int? id;  String? name;  factory TabsAdminWallet.fromDto(TabAdminWalletDto json) {    return TabsAdminWallet(      id: json.id,      name: json.name,    );  }}class FiltersAdminWallet {  FiltersAdminWallet({    this.id,    this.name,  });  int? id;  String? name;  factory FiltersAdminWallet.fromDto(FiltersAdminWalletDto json) {    return FiltersAdminWallet(      id: json.id,      name: json.name,    );  }}